import React, { Component } from 'react'

export class Counter extends Component {
        state = {
            count: 0
        }


  render() {
    return (
      <div>
        <h1>Counter</h1>
        <button>+</button>
        <button>-</button>
        <p>Count: {this.state.count}</p>
      </div>
    )
  }
}

export default Counter
